Almost everytime I pass through the Bay Bridge going to SF, I fire my camera in burst mode and try and see what I get. A lot of blurred cables, up-close, and very few clear shots like this. I should say, I am a passenger when I take these shots.

Here you can see the Transamerica pyramid, Embarcadero towers, Ferry building, Coit tower, and the Golden Gate bridge.

&nbsp;
Thanks for dropping by!
